function SingleStudent ({name, photo, skill}){

    return(
        <>
            <div className="col-md-4">
                <div className="team-member">
                    <img src={photo} alt="" />
                    <h3>{name}</h3>
                    <p>{skill}</p>
                </div>
            </div>
        </>
    );
}

export default SingleStudent;
